import React, { Component } from "react";

class Dashboard extends Component {
  state = {
    loading: true,
    sample_id: null
  };

  componentDidMount() {
    fetch(
      "http://20.191.211.229:5000/v1/datafiles/bb1ba6fb-d579-11eb-b498-000d3acc2c10/metadata",
      {
        method: "GET",
        headers: {
          "Content-Type": "application/json"
        }
      }
    )
      .then(res => {
        return res.json();
      })
      .then(data => {
        this.setState({ sample_id: data.sample_id });
      });
  }

  render() {
    return (
      <div>{(this.state.loading || !this.state.sample_id) ? <h1>Loading...</h1> : 
      <h1>{}</h1>}</div>
    );
  }
}

export default Dashboard;
